var app=angular.module("appAssign",[]);app.controller("MainController",["$scope","$http",function(a,b){a.assignment={},a.assignments=[];var c=function(){return b.get("/assignments").then(function(b){if(200!==b.status)throw new Error("Failed to fetch assignments from the API");return a.assignment={},a.assignments=b.data,b.data})};a.add=function(a){return b.post("/assignments",a).then(c())},c()}]);